export default function Focused(props) {

  const renderFocusedList = () => {
    return props.focused.map((item, i) => (
      <div style={{width: "40vw", height: "30px", backgroundColor: "blue"}} key={`F${i}`}>{item[0].resources[0].data.name}</div>
    ))
  }

  return (
    <div style={{
      position: "absolute", 
      width: "33vw", 
      height: "85.5vh", 
      left: "65.5vw",
      top: "12.8vh"
    }}>{renderFocusedList()}</div>
  )
}
